import java.util.ArrayList;
import java.util.List;

public class Q1047 {

    public static void main(String[] args) {
        System.out.println(new Q1047().removeDuplicates(""));
    }

    public String removeDuplicates(String S) {
        List<Character> sc = new ArrayList<>();
        for (char c : S.toCharArray()) {
            sc.add(c);
        }
        while (true) {
            boolean flag = false;
            for (int i = 0; i < sc.size() - 1; i++) {
                while (i < sc.size() - 1 && sc.get(i) == sc.get(i + 1)) {
                    sc.remove(i);
                    sc.remove(i);
                    flag = true;
                }
            }
            if (!flag) {
                break;
            }
        }
        StringBuilder sb = new StringBuilder();
        for (char c : sc) {
            sb.append(c);
        }
        return sb.toString();

    }
}
